import React from 'react';
import { Contextt } from '../App';
import {Route} from 'react-router-dom';
import Post from '../components_new/post/post';
import PostPage from '../components_new/post-page/post-page';



export default () => {
    return (
        <div> 
            <h1>Posts</h1>
            <Contextt.Consumer>
                {
                    (obj) => {
                        return (
                            <div className={classes.one}>
                            {obj.posts.map((v) => 
                                <Post 
                                    key={v.postId}
                                    id={v.postId}
                                    author={v.author}
                                    date={v.date}
                                    title={v.title}
                                    disc={v.shordDesc}
                                    comments={v.comments}/>
                            )}</div>
                        );

                    }
                }
            </Contextt.Consumer>
            <Route path='/posts/:id' component={PostPage}/>
        </div>
    );
}
